    Fund and to clarify the employer and occupation for Cheryl Sullivan and Tamara
    Mitchell. - In reference to you letter dated March 24, 2006 the telemarketing
    did not clearly identify a Federal office nor promote support or attack a candidate
    nor opponent of a candidate for federal office. 2. No state, district or local
    employee at the time of these reports were spending 25% or more of there time
    working on Federal Election Activity.  3.  The totals on lines 11 and 17 have
    been corrected. In reference to you letter dated May 12, 2006 the catering expenses
    were for meetings  none of these expenditures were made on behalf of a specifically
    identified candidate there were no funds collected at this meeting. (2) the memo
    entries have been identified (3) the payments for the Voter Activation Network
    were not for generic voter drive activities."
